import React from "react";
import { useNavigate } from "react-router-dom";
import { Button, Card, CardContent, Grid } from "@mui/material";

export const Login = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={1}>
        <Card>
          <CardContent>
            <h3>
              <span>Medi</span>
            </h3>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
};
